# frozen_string_literal: true

require "json"

class AddressData
  Coords  = Struct.new(:lat, :lng)
  Address = Struct.new(:coords, :bezirk, :address, :street_name, :street_number, :city, :plz)
  def initialize
    @addresses = JSON.load(JSON_DATA).compact.map { |a|
      f = a["features"].first
      next if f.nil?

      p = f.fetch("properties", {})
      Address.new(
        Coords.new(*f["geometry"]["coordinates"].reverse),
        p["Bezirk"],
        p["Adresse"],
        p["StreetName"],
        p["StreetNumber"],
        p["Municipality"],
        p["PostalCode"]
      )
    }.compact
    @working_copy = @addresses.shuffle
    @i = 0
  end

  def next_address
    @i = 0 if @i == @working_copy.size
    address = @working_copy[@i]
    @i += 1
    address
  end

  def reshuffle!
    @working_copy = @addresses.shuffle
  end
end

